import { Container } from "./styles";

const Header = () => {
  const total = JSON.parse(localStorage.getItem("@kenzieShop/CART")).reduce(
    (acc, { quantity }) => {
      acc += quantity;
    }
  );
  return (
    <Container>
      <div className="headerBox">
        <h1>Kenzie Shop</h1>
        <div className="menu">
          <button>Cart</button>
          <button>Login</button>
        </div>
      </div>
    </Container>
  );
};

export { Header };
